import Link from "next/link";

export default ({ currentUser }) => {
    const links = [
        !currentUser && { label: "Sign Up", href: "/auth/signup" },
        !currentUser && { label: "Sign In", href: "/auth/signin" },
        currentUser && { label: "Sell Tickets", href: "/tickets/new" },
        currentUser && { label: "My Orders", href: "/orders" },
        currentUser && { label: "Sign Out", href: "/auth/signout" },
    ]
        .filter((linkConfig) => linkConfig)
        .map(({ label, href }) => {
            return (
                <li key={href}>
                    <Link href={href}>
                        <a className="f6 link dib white dim mr3 mr4-ns">
                            {label}
                        </a>
                    </Link>
                </li>
            );
        });

    return (
        <nav
            class="flex justify-between bb b--white-10"
            style={{ backgroundColor: "#06A69E" }}
        >
            <a
                class="link white-70 hover-white no-underline flex items-center pa3"
                href=""
            >
                MotorHub
            </a>
            <div class="flex-grow pa3 flex items-center list pl0">{links}</div>
        </nav>
    );
};

